import React from 'react';

const Films = props => (

    <div className="container">
        <div className="row">
            {props.films.map((film) => {
                return (
                    <div key={film.imdbID}>
                        <img src={film.Poster} alt={film.Title}></img>
                        <p >{film.Title}</p>
                    </div>
                );
            })}

        </div>

    </div>
);

export default Films;
